 Ya'll I could Jump to the moon! Not one but 2 different MD's said that my #PCOS is reversed!!! All the blood, sweat, and tears since being diagnosed 2 years ago made this day so worth it! 

Here is my story. 
Truth Bomb 💣 I am overweight I probably have been my entire life.  At 30 when I was diagnosed my dr, like so many others before me, told me that to help manage my PCOS I needed to lose weight. Like so many others diagnosed with PCOS I was frustrated. How are you supposed to lose weight when you have a disorder that literally causes you to gain weight? To top it all off at the same time I was diagnosed with hypothyroidism another disease that causes you to gain weight. Icing on the freaking cake right?
I was so angry and frustrated at myself for not taking care of my health but the biggest stigma to overcome was that I caused the PCOS because I was overweight. When in fact it could have contributed to the rapid weight gain I experienced in my mid-twenties.

 I feel like I need to share something because I had to get this in my brain in order to change my lifestyle if you are overweight and are dealing with a PCOS diagnosis being told to #loseweight is not the same as being told that you caused it to happen in the first place, but in order to move forward, heal, repair, or even manage, you have to take where you are now, own it, and change. #Change is required for growth of #mind, #body, and #soul.

Well, you cannot change or control how your hormones respond on the inside unless you make changes and control what you do on the outside. I made changes, really good ones... atleast for me. I exercise regularly, I eat a #ketodiet with the occasional forbidden fruits, veggies, and beans, I almost always eat #glutenfree, I rarely eat sugar, drink a gallon of water a day, read and meditate. I haven't hit my #weightloss #goals yet but I know I will. More importantly I feel most totally awesome! 
Showing up is the hardest part of achieving your goals. #Showup its worth  #pcosawareness #goaldigger #weightlossjourney #goodvibes #ketopcos #inspired #keepworking";}i:69;a:1:{s:14:"comments_count";i:3;}i:70;a:1:{s:11:"likes_count";i:3;}i:71;a:1:{s:4:"link";s:39:"https://www.instagram.com/p/CEuSmCLA2c-";}i:72;a:1:{s:5:"image";s:249:"https://scontent-sin6-2.cdninstagram.com/v/t51.2885-15/e35/p1080x1080/118734699_331371241309942_6358669314993184254_n.jpg?_nc_ht=scontent-sin6-2.cdninstagram.com&_nc_cat=110&_nc_ohc=G3YPBrjPn_UAX__7Uvs&oh=426374f780f9047b0973e181bc5b0080&oe=5F7CFD76";}i:73;a:1:{s:4:"type";s:5:"image";}i:74;a:1:{s:8:"owner_id";i:18551319521;}i:75;a:1:{s:14:"owner_username";s:0:"";}i:76;a:1:{s:14:"owner_fullname";s:0:"";}i:77;a:1:{s:9:"owner_pic";s:0:"";}i:78;a:1:{s:2:"id";s:19:"2390930229827573559";}i:79;a:1:{s:10:"short_code";s:11:"CEuSmBXnZc3";}i:80;a:1:{s:12:"created_time";i:1599241115;}i:81;a:1:{s:7:"caption";s:669:"If you crave food that isn’t as healthy and try to eat something else, say like grapes or something you won’t be satisfied and you’ll eventually cave in and have the cookies. The only reason this diet/lifestyle change has worked for me is that I eat everything I want. (Just gotta count those calories) if you are having a hard time with dieting believe in yourself one step in front of the other!! 

